const sumFibs = (number:number) => {
  const fib:number[] = [0, 1]
  while (fib.length < number) {
    const lastIndex = fib.length - 1
    // eslint-disable-next-line @typescript-eslint/no-non-null-assertion
    fib.push((fib[lastIndex]!) + (fib[lastIndex-1]!))
  }
  return fib.reduce((acc, cur) => acc + cur)
}

// const result = sumFibs(5)
